
\connect postgres

DROP DATABASE IF EXISTS fipe WITH (FORCE);

CREATE DATABASE fipe WITH TEMPLATE = template0 ENCODING = 'UTF8' LOCALE_PROVIDER = libc LOCALE = 'en_US.utf8';

\connect fipe


CREATE TABLE public.marca (
    id integer NOT NULL,
    codigo integer,
    nome_marca character varying(50) NOT NULL
);

CREATE SEQUENCE public.marca_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE public.marca_id_seq OWNED BY public.marca.id;


CREATE TABLE public.modelo (
    id integer NOT NULL,
    codigo_modelo_fipe integer,
    nome_modelo character varying(100),
    id_marca integer NOT NULL
);

CREATE SEQUENCE public.modelo_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE public.modelo_id_seq OWNED BY public.modelo.id;

CREATE TABLE public.ano (
    id integer NOT NULL,
    codigo character varying(10),
    nome character varying(25),
    ano integer
);

CREATE SEQUENCE public.ano_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE public.ano_id_seq OWNED BY public.ano.id;

CREATE TABLE public.detalhes_veiculo (
    id integer NOT NULL,
    tipo_veiculo integer,
    valor double precision,
    marca character varying(50),
    modelo character varying(100),
    ano_modelo integer,
    combustivel character varying(30),
    codigo_fipe character varying(30),
    mes_referencia character varying(50),
    sigla_combustivel character(1),
    id_modelo integer NOT NULL,
    id_ano integer NOT NULL
);

CREATE SEQUENCE public.detalhes_veiculo_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE public.detalhes_veiculo_id_seq OWNED BY public.detalhes_veiculo.id;


CREATE TABLE public.avaliacao_seguranca (
    id integer NOT NULL,
    imagem_veiculo character varying(255),
    avaliacao_geral character varying(50),
    avaliacao_capotagem character varying(50),
    chance_capotagem double precision,
    overall_front_crash_rating character varying(50),
    front_crash_driverside_rating character varying(50),
    front_crash_passengerside_rating character varying(50),
    overall_side_crash_rating character varying(50),
    side_crash_driverside_rating character varying(50),
    side_crash_passengerside_rating character varying(50),
    combined_side_barrier_and_pole_rating_front character varying(50),
    combined_side_barrier_and_pole_rating_rear character varying(50),
    side_barrier_rating_overall character varying(50),
    rollover_rating2 character varying(50),
    rollover_possibility2 double precision,
    dynamic_tip_result character varying(50),
    side_pole_crash_rating character varying(50),
    nhtsa_electronic_stability_control character varying(50),
    nhtsa_forward_collision_warning character varying(50),
    nhtsa_lane_departure_warning character varying(50),
    complaints_count integer,
    recalls_count integer,
    investigation_count integer,
    model_year integer,
    make character varying(50),
    model character varying(50),
    vehicle_description character varying(100),
    vehicle_id integer,
    id_veiculo integer NOT NULL
);

CREATE SEQUENCE public.avaliacao_seguranca_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE public.avaliacao_seguranca_id_seq OWNED BY public.avaliacao_seguranca.id;


ALTER TABLE ONLY public.ano ALTER COLUMN id SET DEFAULT nextval('public.ano_id_seq'::regclass);


ALTER TABLE ONLY public.avaliacao_seguranca ALTER COLUMN id SET DEFAULT nextval('public.avaliacao_seguranca_id_seq'::regclass);



ALTER TABLE ONLY public.detalhes_veiculo ALTER COLUMN id SET DEFAULT nextval('public.detalhes_veiculo_id_seq'::regclass);



ALTER TABLE ONLY public.marca ALTER COLUMN id SET DEFAULT nextval('public.marca_id_seq'::regclass);



ALTER TABLE ONLY public.modelo ALTER COLUMN id SET DEFAULT nextval('public.modelo_id_seq'::regclass);

















