ALTER TABLE ONLY public.ano
    ADD CONSTRAINT ano_pkey PRIMARY KEY (id);



ALTER TABLE ONLY public.avaliacao_seguranca
    ADD CONSTRAINT avaliacao_seguranca_pkey PRIMARY KEY (id);



ALTER TABLE ONLY public.detalhes_veiculo
    ADD CONSTRAINT detalhes_veiculo_pkey PRIMARY KEY (id);



ALTER TABLE ONLY public.marca
    ADD CONSTRAINT marca_pkey PRIMARY KEY (id);



ALTER TABLE ONLY public.modelo
    ADD CONSTRAINT modelo_pkey PRIMARY KEY (id);



ALTER TABLE ONLY public.avaliacao_seguranca
    ADD CONSTRAINT avaliacao_seguranca_id_veiculo_fkey FOREIGN KEY (id_veiculo) REFERENCES public.detalhes_veiculo(id);



ALTER TABLE ONLY public.detalhes_veiculo
    ADD CONSTRAINT detalhes_veiculo_id_ano_fkey FOREIGN KEY (id_ano) REFERENCES public.ano(id);



ALTER TABLE ONLY public.detalhes_veiculo
    ADD CONSTRAINT detalhes_veiculo_id_modelo_fkey FOREIGN KEY (id_modelo) REFERENCES public.modelo(id);



ALTER TABLE ONLY public.modelo
    ADD CONSTRAINT modelo_id_marca_fkey FOREIGN KEY (id_marca) REFERENCES public.marca(id);




